import logo from "./logo.svg";
import "./App.css";

/**
 * element = <div id = "root"> hello world</div>
 * element = React.createElement("div", {id: 'root'}, 'Hello world');
 *
 */

function Feature() {
  return (
    <div className="feature">
      <img src="" alt="" className="feature-img" />
      <h3 className="feature-title">title2</h3>
      <p>
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Hic
        perspiciatis culpa deleniti error atque explicabo consequatur
        accusantium iusto beatae veniam.
      </p>
    </div>
    // parent component
  );
}
function App() {
  return (
    // children component
    <div className="list">
      {/* <Feature></Feature>
      <Feature></Feature>
      <Feature></Feature> */}
      <Youtube
        image="https://images.unsplash.com/photo-1644982647531-daff2c7383f3?ixlib=rb-1.2.1&ixid=MnwxMjA3fDF8MHxlZGl0b3JpYWwtZmVlZHwxfHx8ZW58MHx8fHw%3D&auto=format&fit=crop&w=500&q=60"
        avata="https://images.unsplash.com/photo-1525310072745-f49212b5ac6d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=465&q=80"
        title="Beautiful girl"
        author="Le Duc Huy"
      ></Youtube>

      <Youtube
        image="https://images.unsplash.com/photo-1545670723-196ed0954986?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MXx8cmVhY3Rqc3xlbnwwfHwwfHw%3D&auto=format&fit=crop&w=500&q=60"
        avata="https://images.unsplash.com/photo-1525310072745-f49212b5ac6d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=465&q=80"
        title="Learn react js"
        author="Le Duc Huy"
      ></Youtube>

      <Youtube
        image="https://images.unsplash.com/photo-1610986602726-19f650133f7a?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Nnx8cmVhY3Rqc3xlbnwwfHwwfHw%3D&auto=format&fit=crop&w=500&q=60"
        avata="https://images.unsplash.com/photo-1525310072745-f49212b5ac6d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=465&q=80"
        title="Learn react js"
        author="Le Duc Huy"
      ></Youtube>

      <Youtube
        image="https://images.unsplash.com/photo-1633356122544-f134324a6cee?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxzZWFyY2h8MTN8fHJlYWN0anN8ZW58MHx8MHx8&auto=format&fit=crop&w=500&q=60"
        avata="https://images.unsplash.com/photo-1525310072745-f49212b5ac6d?ixlib=rb-1.2.1&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=465&q=80"
        title="Learn react js"
        author="Le Duc Huy"
      ></Youtube>
    </div>
  );
}

function Youtube(props) {
  console.log(props);
  return (
    <div className="youtube-item">
      <div className="youtube-img">
        <img src={props.image} alt="youtube" />
      </div>
      <div className="youtube-title">
        <h2>{props.title}</h2>
      </div>
      <div className="youtube-footer">
        <div className="youtube-avata">
          <img src={props.avata} alt="" />
        </div>
        <div className="youtube-author">
          <h3>{props.author}</h3>
        </div>
      </div>
    </div>
  );
}

export default App;
